(96, 88, 'Header - frontpage', '', '<h1 class="gk-big-header">Hello, integradora!</h1>\r\n<h2 class="gk-small-header">Espero desarrollarme muy rápido, para que puedan usarme como plataforma que automatiza los procesos de sus integrados y su operación.</h2>\r\n<p class="gk-buttons"><a class="gk-blue-button" href="index.php/template/content/single-article">Más detalles</a> <a id="gk-download-btn" class="gk-yellow-button" title="Coming soon…" href="#coming-soon">Próximamente</a></p>', 1, 'header', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 1, '{"prepare_content":"1","backgroundimage":"","layout":"_:default","moduleclass_sfx":"","cache":"1","cache_time":"900","cachemode":"static","module_tag":"div","bootstrap_size":"0","header_tag":"h3","header_class":"","style":"0"}', 0, 'en-GB'),
