(100, 93, 'Based on Bootstrap', '', '<div class="container-fluid">\r\n<div class="row-fluid">\r\n<div class="span4 gk-demo-content"><img src="templates/meet_gavern/images/content/joomla30.png" alt="Free Joomla! 3.0 Template" />\r\n<h2>Free Joomla! 3.0 Template</h2>\r\n<p>This is our first and free template built especially for Joomla 3.0. Want to know more about Joomla 3.0?</p>\r\n<a class="btn btn-large" href="http://www.joomla.org/3/">Read more</a></div>\r\n<div class="span4 gk-demo-content"><img src="templates/meet_gavern/images/content/gavern_plus_bootstrap.png" alt="Gavern + Bootstrap" />\r\n<h2>Gavern + Bootstrap</h2>\r\n<p>Meet Gavern is based upon a brand new version of the Gavern Framework which features built-in support for Bootstrap</p>\r\n<a class="btn btn-large" href="index.php/template/content/single-article">Read more</a></div>\r\n<div class="span4 gk-demo-content"><img src="templates/meet_gavern/images/content/responsive_design.png" alt="Responsive Web Design" />\r\n<h2>Responsive Web Design</h2>\r\n<p>Joomla! 3.0 and Gavern Framework are prepared to support Responsive Web Design</p>\r\n<a class="btn btn-large" href="http://gavick.com/magazine/responsive-web-design-necessity-or-fashion.html">Read more</a></div>\r\n</div>\r\n</div>', 1, 'mainbody', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 0, '{"prepare_content":"1","backgroundimage":"","layout":"_:default","moduleclass_sfx":"","cache":"1","cache_time":"900","cachemode":"static","module_tag":"div","bootstrap_size":"0","header_tag":"h3","header_class":"","style":"0"}', 0, 'en-GB'),
